import React from "react";
import Svg from "../Svg";
import { SvgProps } from "../types";

interface LogoProps extends SvgProps {
  isDark: boolean;
}

const Logo: React.FC<React.PropsWithChildren<LogoProps>> = ({ isDark, ...props }) => {
  const textColor = isDark ? "#FFFFFF" : "#000000";
  return (
    <Svg viewBox="0 0 1281 199" {...props}>
      <g clipPath="url(#clip1)">
            {/* <rect width="1281" height="199" fill="purple"/> */}
            <rect x="1" y="1" width="1281" height="199" fill="url(#pattern1)"/>
        </g>
        <defs>
            <pattern id="pattern1" patternContentUnits="objectBoundingBox" width="1" height="1">
                <use xlinkHref="#image1" transform="scale(0.00061, 0.00367)"/>
            </pattern>
            <clipPath id="clip1">
                <rect width="1281" height="199" fill="blue"/>
            </clipPath>
            <image id="image1" width="1281" height="280" xlinkHref="data:image/png;base64,"/>
    </defs></Svg>
  );
};

export default React.memo(Logo, (prev, next) => prev.isDark === next.isDark);
